using DataLayer;
using Model;
using Newtonsoft.Json;
using System;
using System.Collections.Generic;
using System.Net;
using System.Net.Http;
using System.Text;
using TechTalk.SpecFlow;

namespace CucumberTesting
{
    [Binding]
    public class EditStudentSteps
    {
        Client client = new Client();
        StudentViewModel model = new StudentViewModel();
        Student student = new Student();

        [Given(@"A record of Student")]
        public void GivenARecordOfStudent()
        {
            student.StudentId = 85;
            student.Name = "Hamza";
            student.Email = "Hamza@gmail.com";
            student.Password = "kamran";
            student.ConfirmPassword = "kamran";
            student.PhoneNo = 0300;
            model.Student = student;
            string[] imagebase64 = { "" };
            model.ImagePath = imagebase64;
            List<string> courseId = new List<string>();
            courseId.Add("1");
            courseId.Add("3");
            model.Courses = courseId;
        }
        
        [When(@"User click on save button after editing a record")]
        public async System.Threading.Tasks.Task WhenUserClickOnSaveButtonAfterEditingARecordAsync()
        {
            var json = JsonConvert.SerializeObject(model);
            var data = new StringContent(json, Encoding.UTF8, "application/json");
            await client.GeneralRequestAsync("api/student", data, "Put");
        }

        [Then(@"the edited student record should be saved in the database")]
        public void ThenTheEditedStudentRecordShouldBeSavedInTheDatabase()
        {
            Console.WriteLine("");
        }
    }
}
